import React from 'react';
import picture from "./picture.png";
import './App.css';
import {
  RoundedCircle,
} from "bootstrap"

function App() {

    return (
    <div className="App">
        <img src={picture}   roundedCircle   alt="persopicture"     style={{ width: 60, height: 60, borderRadius: 60/ 2}} 
/>

    </div>
  );
}

export default App;
